'id': u'10205994231602269'}, u'id': u'379322602098011_980193'}, {u'message': u'<3', u'from': {u'name': u'Valentina Mu\xf1oz Guzm\xe1n', u'id': u'10205111519016729'}, u'id': u'379322602098011_982003'}, {u'message': u':D', u'from': {u'name': u'Scarlet Vergara', u'id': u'10203412225721118'}, u'id': u'379322602098011_984570'}, {u'message': u'Aplaudo esa respuesta, muy sabia! <3', u'from': {u'name': u'Pedro Antonio Lizama', u'id': u'10207480417830707'}, u'id': u'379322602098011_995313'}, {u'message': u'como cambian los tiempos', u'from': {u'name': u'Alicia Santana', u'id': u'10206754270753911'}, u'id': u'379322602098011_1002837'}, {u'message': u'S√≠, es cierto... por eso estos recordatorios son buenos... hay cosas que no debemos olvidar :) Un abrazo', u'from': {u'category': u'Non-Governmental Organization (NGO)', u'name': u'Psic\xf3logos Voluntarios de Chile', u'category_list': [{u'id': u'2235', u'name': u'Non-Governmental Organization (NGO)'}], u'id': u'124568870906720'}, u'id': u'379322602098011_1002844'}, {u'message': u'antes los matrimonios (cuando se casaban por amor y no eran arreglados), eran mas como un equipo, se apoyaban, se perdonaban, pensaban en el otro..... ahora es una lucha de egoismos, solo se preocupan de que el otro satisfaga las necesidades personales, y si no lo hace, esta todo mal, por ende debe desecharse. Una tristeza....', u'from': {u'name': u'Alicia Santana', u'id': u'10206754270753911'}, u'id': u'379322602098011_1002848'}, {u'message': u'PERO ALICIA...IGUAL TIENES QUE RECORDAR...que antes se vivia en una sociedad mas machista que ahora...donde la mujer aguantaba todo...cuando el marido tenia amantes,la mujer calladita no mas acataba "porque el marido se cansaba por el trabajo y tenia que distraerse"...antes la mujer no podia ser "amante" de su esposo...era mal visto...y cuando el marido le pegaba...calladita no mas se que.daba...era normal...por eso duraban los matrimonios...ahora tenemos voz y voto...y no aguantamos maltratos...', u'from': {u'